syntax = "proto3";

package cmdid;
//生成go文件的路径
option go_package          = "./cmdid";

enum CmdId {
  Default = 0;
  Ping = 1000;
  GetUserInfo = 1001;
  StartGame = 1002;
  StartBattle = 1003;
  UpdateCharacterDie = 1004;
  GameResult = 1005; 


  EventOnReconnect = 20001;
  EventServerReady = 20002;	
}
